import React from "react";

function SlideShow() {
  const [gallery, setGallery] = useState([]);
  const fetchData = async () => {
    const response = await fetch("/data.json");
    const data = await response.json();

    setGallery(data);
  };
  useEffect(() => {
    fetchData();
  }, []);
  return <div>SlideShow</div>;
}

export default SlideShow;
